  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键,自增id',
  `category_id` int(11) NOT NULL COMMENT '电视剧类别id',
  `language_id` int(11) NOT NULL COMMENT '语言id',
  `country_id` int(11) NOT NULL COMMENT '国家地区id',
  `title` varchar(60) NOT NULL DEFAULT '' COMMENT '剧名',
