  `is_dig` tinyint(4) NOT NULL COMMENT '0,普通剧 1推荐热播',
  `is_published` int(11) NOT NULL DEFAULT '1' COMMENT '0,表示 未发行，1表示发行',
  `is_complete` int(11) NOT NULL DEFAULT '0' COMMENT '已编辑完整',
  `cover_image` varchar(100) NOT NULL DEFAULT '' COMMENT '封面URL',
  `is_lock` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否锁定',
  `is_deleted` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否删除 0 正常 ；1已删除',
  `updated` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' ON UPDATE CURRENT_TIMESTAMP COMMENT '修改日期',
  `created` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建日期',
  `u_timestamp` int(11) NOT NULL COMMENT '记录更新unix时间戳',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `title` (`title`) USING BTREE,
  KEY `tv_first_play_date` (`tv_first_play_date`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='电视剧表';

